import React from "react";

// To do refactor this component to be the page that renders all of the cards with the data. For instal spending card, networth card, graph of increase in spend etc.

export default () => {
  const name = "Kyle";

  return (
    <React.Fragment>
      <div>
        <h2>Hi {name}, here's your financial snapshot!</h2>
      </div>
      <div className="ui card">
        <div className="content">
          <div className="header">Net Spend</div>
        </div>
        <div className="content">
          <h4 className="ui sub header">Income:</h4>
          <h4 className="ui sub header">Spent:</h4>
          <h4 className="ui sub header">Net:</h4>
        </div>
      </div>
    </React.Fragment>
  );
};
